JOIN Parties.Brands b ON bca.BrandId = b.BrandId
JOIN Lookups.Countries c1 on bca.CountryIso = c1.Iso
JOIN Lookups.Currency c ON bcsl.DeclarationCurrencyId = c.CurrencyId
JOIN Lookups.PackageIncoTermCodes p ON bcsl.PackageIncoTermCodeId = p.PackageIncoTermCodeId
JOIN Lookups.ServiceLevels sl ON bcsl.ServiceLevelId = sl.ServiceLevelId
WHERE b.BrandName = 'Vinicio Boutique'
ORDER BY c1.Iso, sl.NAME

